import React, { Component } from "react";

class NavBar extends Component {
  state = {};
  render() {
    return (
      <React.Fragment>
        <div className="header_navbar">
          <a
            className="header_elements"
            href="https://www.vhv.rs/dpng/d/433-4338775_amazon-prime-instant-video-logo-png-amazon-prime.png"
          ></a>
          <div className="header_elements">Home</div>
          <div className="header_elements">TV Shows</div>
          <div className="header_elements">Movies</div>
          <div className="header_elements">Kids</div>
        </div>
      </React.Fragment>
    );
  }
}

export default NavBar;
